/div>\n    <br>\n    <div><div style=\"font: bold; font-size: 20px\">\n            Campingvogn\n        </div>\n        <div>\n            Find din bedste camping-habit, de hvide tennisstrømper og H2O klip-klapperne frem fra gemmerne, støv klapstolene af og kom af sted: Det her er god, gammeldags komfortabel camping!\n        </div></div>\n    <br>\n    <div><div style=\"font: bold; font-size: 20px\">\n            Andre sjove boformer\n        </div>\n        <div>\n            Efterhånden kan du vælge at bo på en lang række måder på Miljøfest. De festivalboliger, du kan tilkøbe, er meget forskellige og placeret spredt rundt omkring festivalpladsen.\n        </div></div>\n    <br>\n    <div><div style=\"font: bold; font-size: 20px\">\n            Camping- og teltregler\n        </div>\n        <div>\n            Miljøfest er ANTIDAGLIGDAG med stort A, men for at det ikke bliver ANARKI at bo 5000 mennesker sammen i et kollektiv, har vi nogle campingregler.\n        </div></div></div></div>");
